import { Component } from "react";

class FooterComponent extends Component {
    render() {
        return (
            <footer className="footer justify-content-between align-items-center py-3 my-4 border-top">
                <span className="text-muted">Gym Progress Tracker &copy; 2022</span>
            </footer>
        );
    }
}

export default FooterComponent;
